import React from 'react';
import LoadingPage from './comp/LoadingPage';
import GlobalMap from './comp/GlobalMap';
import './App.css';

const App = () => {
    return (
        <div className="App">
            <LoadingPage /> {/* Display the loading page with video */}
            <div className="content">
                <h1>Interactive Map with Popup Cards</h1>
                <GlobalMap />
            </div>
        </div>
    );
};

export default App;
